(function(){var n={"0":"未知","1":"男","2":"女"};new Vue({el:"#app",data:{pageIndex:1,list:[],pageCount:undefined,pageSize:2},methods:{phoneFilter:function(n){return n.phone?n.phone:"未绑定"},genderFilter:function(t){return n[t.gender]},loadData:function(){var n=this;axios.get(`/User/GetList?pageIndex=${this.pageIndex}&pageSize=${this.pageSize}`).then(function(t){n.list=t.data.list;n.pageCount=Math.ceil(t.data.rows/n.pageSize)})},prev:function(){this.pageIndex!=1&&(this.pageIndex--,this.loadData())},next:function(){this.pageIndex!=this.pageCount&&(this.pageIndex++,this.loadData())},page:function(n){this.pageIndex=n;this.loadData()}},created:function(){this.loadData()}})})();